import * as React from 'react';

import Equipment from './Equipment';


export default function AssetInsert(props) {
   



    const { name, label, value, onChange, options, restart } = props;
    switch(label){
        case "Equipment":
            return <Equipment
            options={options}/>;
            break;
        case "Farms/Paddock":
            break;
        case "Chemicals":
            break;
    }
    
}
